const links = [
  "https://www.tiktok.com/@aliabdaal/video/7089786342699240709",
  "https://www.tiktok.com/@aliabdaal/video/7072472450629487878",
  "https://www.tiktok.com/@aliabdaal/video/6987876630148467973",
  "https://www.tiktok.com/@aliabdaal/video/7517613597250407702",
  "https://www.tiktok.com/@aliabdaal/video/7517613119246568726"
];

return links.map((url, index) => ({
  json: {
    videoUrl: url,
    fileName: `video${index + 1}.mp4`
  }
}));

{
  "name": "Rename MP4 Files Sequential",
  "nodes": [
    {
      "parameters": {
        "path": "/path/to/your/mp4/files",
        "fileFilter": "*.mp4"
      },
      "id": "read-files",
      "name": "Read Files",
      "type": "n8n-nodes-base.readBinaryFiles",
      "position": [240, 300]
    },
    {
      "parameters": {
        "jsCode": "// Add sequential numbering to items\nfor (let i = 0; i < items.length; i++) {\n  items[i].json.newFileName = `video${i + 1}.mp4`;\n  items[i].json.originalName = items[i].json.fileName;\n}\n\nreturn items;"
      },
      "id": "add-numbering",
      "name": "Add Sequential Numbers",
      "type": "n8n-nodes-base.code",
      "position": [460, 300]
    },
    {
      "parameters": {
        "operation": "rename",
        "path": "={{ $json.originalName }}",
        "newPath": "={{ $json.newFileName }}"
      },
      "id": "rename-files",
      "name": "Rename Files",
      "type": "n8n-nodes-base.filesAndFolders",
      "position": [680, 300]
    }
  ],
  "connections": {
    "Read Files": {
      "main": [
        [
          {
            "node": "Add Sequential Numbers",
            "type": "main",
            "index": 0
          }
        ]
      ]
    },
    "Add Sequential Numbers": {
      "main": [
        [
          {
            "node": "Rename Files",
            "type": "main",
            "index": 0
          }
        ]
      ]
    }
  }
}
